<?php

namespace App\Controller\Api;

use App\Entity\Products;
use Symfony\Bundle\FrameworkBundle\Controller\AbstractController;
use Symfony\Component\HttpFoundation\Request;
use Symfony\Component\Routing\Annotation\Route;

class ProductsController extends AbstractController
{
    /**
     * @Route("/api/products/add", name="api_products_add")
     */
    public function index()
    {
        function base64_to_jpeg($base64_string, $output_file) {
            // open the output file for writing
            $ifp = fopen( $output_file, 'wb' );

            // split the string on commas
            // $data[ 0 ] == "data:image/png;base64"
            // $data[ 1 ] == <actual base64 string>
            $data = explode( ',', $base64_string );

            // we could add validation here with ensuring count( $data ) > 1
            fwrite( $ifp, base64_decode( $data[ 1 ] ) );

            // clean up the file resource
            fclose( $ifp );

            return $output_file;
        }
        $base64_string = 'data:image/png;base64,';
        $date = date('mdYhisms', time());
        $filename = $date.'.png';
        $filepath = "uploads/a".$filename;
//        $file2 = $base64_string($base64_string,$filepath);
        file_put_contents($filepath, file_get_contents($base64_string));
        return $this->render('api/products/index.html.twig', [
            'controller_name' => 'ProductsController',
        ]);
    }

    /**
     * @Route("/api/products/list", name="api_products_list")
     */
    public function productList() {
        $products = $this->getDoctrine()->getRepository(Products::class)->findBy([],['id' => 'DESC']);
        return $products;
    }

    /**
     * @Route("/api/products/list/search", name="api_products_list_search")
     */
    public function productListSearch(Request $request) {
        $repository = $this->getDoctrine()
            ->getRepository(Products::class);
        $query = $repository->createQueryBuilder('p')
            ->where('p.name LIKE :search')
            ->setParameter('search', '%'.$request->get('search').'%')
            ->orderBy('p.id', 'DESC')
            ->getQuery();
        $products = $query->getResult();
        return $products;
    }

    /**
     * @Route("/api/products/add/new/products", name="api_products_add_new_products")
     */

    public function addNewProducts(Request $request) {
        $product = New Products();
        $product->setName($request->get('name'));
        $product->setPrice($request->get('price'));
        $date = date('mdYhisms', time());
        $filename = $date.'.jpeg';
        $filepath = "uploads/images".$filename;
        file_put_contents($filepath, file_get_contents($request->get('image')));
        $product->setPoster($filepath);
        $em = $this->getDoctrine()->getManager();
        $em->persist($product);
        $em->flush();
        return 'success';
    }
}
